(3, 'Terms and Condition', 'terms-and-condition', NULL, NULL, '<p>Your access to and use of the CourierCLS Website (the \\"Site\\") is subject to the following terms and conditions (\\"Terms and Conditions\\") and all applicable laws. By accessing and browsing the Site, you accept, without limitation or qualification, the Terms and Conditions and acknowledge that any other agreements between you and CourierCLS are superseded and of no force or effect.</p>\r\n<h3>1. Terms and Conditions:</h3>\r\n<ul>\r\n<li>Changes and cancellations require 24 hours advance notice on- line or can be made within 2 hours (nationwide) by calling CourierCLS at (877) 892-6182 for calls outside the U.S. and Canada</li>\r\n<li>CourierCLS monitors all commercial airline arrivals. A 30-minute grace period is allowed on all domestic arrivals and 60 minutes on all international arrivals. After the grace period, waiting time charges will apply. Waiting time charges are accrued in quarter hour increments, based on the vehicle&rsquo;s hourly rate.</li>\r\n<li>A 15-minute grace period is allowed on pick-ups other than at an airport. After the grace period, waiting time charges will apply. Waiting time charges are accrued in quarter hour increments, based on the vehicle&rsquo;s hourly rate.</li>\r\n<li>Full fare (including a 20% gratuity) will be billed for late cancellations. If you cannot locate your driver please call CourierCLS at (877) 892-6182 for calls outside the U.S. and Canada. To avoid being billed as a no-show, we advise you not to leave your location without contacting CourierCLS.</li>\r\n<li>Rates are subject to change without notice. CourierCLS is not responsible for services delayed or not rendered due to weather or other circumstances beyond its control.</li>\r\n<li>RATE ESTIMATE The rate presented to you prior to your trip is an initial estimate of the cost of service as reserved. Wait time, taxes, extra stops or additional services may change your rate.</li>\r\n</ul>\r\n<h3>2. Use of Personal Data.</h3>\r\n<p>CourierCLS Worldwide Chauffeured Services (\\"CourierCLS\\") takes your privacy very seriously and understands the importance of knowing how your personal information is being used and shared. For more information See <a>Privacy Policy</a>.</p>\r\n<h3>3. Copyrights, Trademarks and Ownership.</h3>\r\n<p>All content included on the Site, including text, graphics, logos, images, news, articles, software scripts and applets (\\"Content\\"), is the property of CourierCLS or its affiliates, and is protected by United States and International copyright laws. You may not modify, copy, distribute, transmit, display, perform, reproduce, publish, license, create derivative works from, transfer, or sell any information, software, or services obtained from the Site without the written permission of CourierCLS. Any other use, including the reproduction, modification, distribution, transmission, republication, display or performance, or any exploitation, of the Site or any of the Content or software on the Site, in whole or in part, is strictly prohibited.</p>\r\n<p>The trademarks, logos, and service marks (collectively the \\"Trademarks\\") displayed on the Site are the registered and unregistered Trademarks of CourierCLS and others.</p>\r\n<p>Nothing contained on the Site should be construed as granting, by implication, estoppel, or otherwise, any license or right to use any Trademark displayed on the Site without the written permission of CourierCLS or such third party that may own the Trademarks displayed on the Site. Your misuse of the Trademarks displayed on the Site, or any other content on the Site, except as provided in these Terms and Conditions, is strictly prohibited. CourierCLS will aggressively enforce its intellectual property rights to the fullest extent of the law.</p>\r\n<h3>4. Disclaimers of Warranties and Liability.</h3>\r\n<p>CourierCLS DOES NOT WARRANT OR MAKE ANY REPRESENTATIONS REGARDING THE USE OR THE RESULTS OF THE USE OF THE