scene, scandalous, inflammatory, pornographic, or profane material or any materials that could constitute or encourage conduct that would be considered a criminal offense, give rise to civil liability, or otherwise violate any law. CourierCLS will fully cooperate with any law enforcement authorities or court order requesting or directing CourierCLS to disclose the identity of anyone posting such information or materials.</p>\r\n<h3>6. Informational Hyperlinks.</h3>\r\n<p>The Site may contain hyperlinks to websites operated by parties other than CourierCLS. Such hyperlinks are provided for your reference only.</p>\r\n<p>CourierCLS explicitly disclaims responsibility for the accuracy, copyright compliance, or reliability of material provided by or about third parties. Furthermore, CourierCLS does not make any representations or warranties as to the security of any information (including, without limitation, credit card and other personal information) you might be requested to give any third party, and you hereby irrevocably waive any claim against CourierCLS with respect to such other operator or company. CourierCLS strongly encourages you to make whatever investigation you feel necessary or appropriate before proceeding with any online or offline transaction with any other operator or company.</p>\r\n<h3>7. Software Available on the Site.</h3>\r\n<p>CourierCLS hereby grants to you, the user, a personal, nontransferable license to use any downloadable software applets (\\"the Software\\") for viewing and otherwise using the Site in accordance with these Terms and Conditions and for no other purpose.</p>\r\n<p>Please note that all Software, including without limitation all HTML code, Java Script and ActiveX controls contained in the Site, is owned by CourierCLS, its affiliates, and/or its suppliers and is protected by copyright laws and international treaty provisions. Any reproduction or redistribution of the Software is expressly prohibited by law.</p>\r\n<p>WITHOUT LIMITING THE FOREGOING, COPYING OR REPRODUCTION OF THE SOFTWARE TO ANY OTHER SERVER OR LOCATION FOR FURTHER REPRODUCTION OR REDISTRIBUTION IS EXPRESSLY PROHIBITED. THE SOFTWARE IS WARRANTED, IF AT ALL, ONLY ACCORDING TO THE TERMS OF THE LICENSE AGREEMENT.</p>\r\n<h3>8. Use of CourierCLS\\''s Customer Online Services.</h3>\r\n<p>The Site is provided solely for assisting CourierCLS\\'' customers in making legitimate reservations, retrieving online ride receipts or otherwise transacting business with CourierCLS, and for no other purposes. You agree to be financially responsible for all of your use of the Site (as well as for use of your account by others, including without limitation, minors living with you). You agree to supervise all usage by minors of the Site under your name or account. You also warrant that all information supplied by you or members of your household in using the Site is true and accurate. You understand that overuse or abuse of the reservation request facilities of the Site may result in your being denied access to such facilities.</p>\r\n<h3>9. General.</h3>\r\n<p>This agreement is governed by the laws of the State of New York, U.S.A., without regard to principals of conflicts of law. You hereby consent to the exclusive jurisdiction and venue of courts in Columbia County, New York, U.S.A., in all disputes arising out of or relating to the use of the Site. Use of the Site is unauthorized in any jurisdiction that does not give effect to all provision of these Terms and Conditions, including without limitation this paragraph.</p>\r\n<p>If any part of this agreement is determined to be invalid or unenforceable pursuant to applicable law including, but not limited to, the warranty disclaimers and liability limitations set forth above, then the invalid or unenforceable provision will be deemed superseded by a valid, enforceable provision that most closely matches the intent of the original provision and the remainder of the agreement shall continue in effect.</p>\r\n<p>This agreement constitutes the entire agreement between the customer and CourierCLS with respect to the Site and supersedes all prior or contemporaneous communications and proposals, whether electronic, oral, or written, between the customer and CourierCLS with respect to the Site. A printed version of this agreement and of any notice given in electronic form shall be admissible in judicial or administrative proceedings based upon or relating to this agreement to the same extent and subject to the same conditions as other business documents and records originally generated and maintained in printed form.</p>\r\n<p>Any rights not expressly granted herein are reserved.</p>\r\n<p>CourierCLS may at any time without notice revise these Terms and Conditions by updating this page. You are bound by any such revisions and should therefore; periodically visit this page to review the then currrent Terms and Conditions. Your use of CourierCLS\\'' services indicates your acceptance of these Terms and Conditions.</p>', '<h6 class=\\"\\\\&quot;vlist\\\\&quot;\\">IMPORTANT INFORMATION</h6>\r\n<ul class=\\"\\\\&quot;vlist\\\\&quot;\\">\r\n<li class=\\"\\\\&quot;active\\\\&quot;\\"><a href=\\"\\\\\\">Travelling with childre</a></li>\r\n<li><a href=\\"\\\\\\">Passengers with special needs</a></li>\r\n<li><a href=\\"\\\\\\">Travel documents</a></li>\r\n<li><a href=\\"\\\\\\">Special documents</a></li>\r\n<li><a href=\\"\\\\\\">At the airport</a></li>\r\n<li><a href=\\"\\\\\\">Carrying animals</a></li>\r\n<li><a href=\\"\\\\\\">Baggage</a></li>\r\n<li><a href=\\"\\\\\\">Check-in</a></li>\r\n<li><a href=\\"\\\\\\">On board</a></li>\r\n<li><a href=\\"\\\\\\">FAQ</a></li>\r\n<li><a href=\\"\\\\\\">Passenger rights</a></li>\r\n<li><a href=\\"\\\\\\">General Conditions of Carriage</a></li>\r\n</ul>', '/terms.html', 3, NULL, '2012-08-26 04:00:00', '2012-08-26 23:26:14', '2012-09-10 19:48:19', 1, 2, 3, 1, 4, 6, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(4, 'At The Airport', 'at-the-airport', NULL, NULL, '<p>At the airport</p>', '<ul>\r\n<li>Look for a car</li>\r\n<li>Make sure that you ....</li>\r\n<li>Present your recipt to the driver</li>\r\n<li>Have your credit card ready</li>\r\n</ul>', '/at-the-airport.html', 3, NULL, '2012-08-31 04:00:00', '2012-08-31 16:29:19', '2012-09-11 02:01:34', 1, 1, 2, 0, 2, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(6, 'Important information', 'important-information', NULL, NULL, NULL, '<h6 class=\\"vlist\\">IMPORTANT INFORMATION</h6>\r\n<ul class=\\"vlist\\">\r\n<li class=\\"active\\"><a href=\\"#\\">Travelling with childre</a></li>\r\n<li><a href=\\"#\\">Passengers with special needs</a></li>\r\n<li><a href=\\"#\\">Travel documents</a></li>\r\n<li><a href=\\"#\\">Special documents</a></li>\r\n<li><a href=\\"#\\">At the airport</a></li>\r\n<li><a href=\\"#\\">Carrying animals</a></li>\r\n<li><a href=\\"#\\">Baggage</a></li>\r\n<li><a href=\\"#\\">Check-in</a></li>\r\n<li><a href=\\"#\\">On board</a></li>\r\n<li><a href=\\"#\\">FAQ</a></li>\r\n<li><a href=\\"#\\">Passenger rights</a></li>\r\n<li><a href=\\"#\\">General Conditions of Carriage</a></li>\r\n</ul>', '/important-information.html', 1, NULL, '2012-09-03 04:00:00', '2012-09-03 10:56:13', '2012-09-10 19:48:19', 0, 1, 6, 0, 4, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(8, 'Important Information', 'important-information', NULL, NULL, NULL, '<div id=\\"col1_content\\">\r\n<h6 class=\\"vlist\\">IMPORTANT INFORMATION</h6>\r\n<ul class=\\"vlist\\">\r\n<li class=\\"active\\"><a href=\\"/terms.html\\">Terms and Conditions</a></li>\r\n<li><a href=\\"/privacy-policy.html\\">Privacy Policy</a></li>\r\n</ul>\r\n</div>', '/important-info.html', 3, NULL, '2012-09-10 04:00:00', '2012-09-10 19:47:14', '2012-09-11 01:56:56', 0, 1, 2, 0, 5, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(9, 'About CourierCLS', 'about-couriercls', NULL, NULL, '<p>When you\\''re in charge of getting that somebody special from Point A to Point B, you want only the best. Whether it\\''s the CEO of your largest client, your beautiful daughter and her wedding party or taking that special person out for the evening, knowing that they arrived safely and on time is the most important factor. You want to put those important to you in the hands of somebody like you that has their safety at heart as much as getting them there on time.</p>\r\n<p>That\\''s why you call a transportation company like CourierCLS.&nbsp; When our highly trained, experienced and uniformed chauffeurs arrive in one of our new, sleek, shiny, styling vehicles, you\\''ll know you made the right call.&nbsp; We know that the destination is only part of the equation. The presentation and the functionality are just as important.&nbsp;</p>\r\n<p>When it comes to transporting those important to you, CourierCLS won\\''t send in the clowns! We only send out the best of the best in the best vehicle for your needs.&nbsp;</p>', '<div id=\\"col1_content\\">\r\n<h6 class=\\"vlist\\">Highlights</h6>\r\n<ul class=\\"vlist\\">\r\n<li><a>Excellent customer service</a></li>\r\n<li><a>No hidden fees; fine print</a></li>\r\n<li><a>Complete focus on your satisfaction</a></li>\r\n<li><a>We don\\''t share <em>your</em> ride</a></li>\r\n<li><a>Quick transportation to/from JFK, LGA and EWR</a></li>\r\n<li><a>Consistent and accurate rates available before your trip</a></li>\r\n</ul>\r\n</div>', '/about-couriercls.html', 3, NULL, '2012-09-10 04:00:00', '2012-09-11 01:49:15', '2012-09-15 12:04:32', 1, 1, 2, 0, 6, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(10, 'Why CourierCLS', 'why-couriercls', NULL, NULL, '<p>With so many options to get around the New York and surrounding areas, why should you choose CourierCLS?  Besides the fact that you can rest easy knowing that your passengers are safe and will arrive on time, here are a few other reasons you should choose CourierCLS:</p>\r\n<ul>\r\n<li>We are locally owned and we are everywhere you need us. No matter where you are in the tri-state area, CourierCLS is just a phone call and a short distance away. Don\\''t worry about extra mileage charges because we had to come across the river to get you. We\\''re already there!</li>\r\n<li>We operate 24 hours a day, 7 days a week with a full staff of experienced, knowledgeable travel experts to book your transportation needs the most efficient and cost effective way possible and  experienced, trained chauffeurs. CourierCLS is always on-call and ready to go a moments notice or book ahead  for that special event. We\\''ll be here for you. The hotel leaves the light on for you &hellip; We leave the motor running for you.</li>\r\n<li>We not only arrive at pick up on, but we make sure our passengers arrive on time, safe, secure, sound. With only experienced and trained chauffeurs that know the area better than our passengers, we don\\''t have to offer you a free trip to back up our guarantee. We know we\\''ll be on time, every time.</li>\r\n<li>The newest, sleek and sexy fleet of cars are at your service with CourierCLS. Our entire fleet is equipped with the finest, newest equipment inside for your convenience on the inside. We have only the best technology available for our drivers to navigate their way around traffic and construction to your desired location, and under the hood, the power that is second only to a race car while being environmentally conscious too.</li>\r\n</ul>\r\n<p>CourierCLS knows that it\\''s not just getting you to your destination that counts, but how it looks, rides and feels is important too. No matter if your chauffeur needs are for transporting a wedding party, those special customers or just a weekend of romance with your love, CourierCLS is the service you need to make it all happen.</p>', '<div id=\\"col1_content\\">\r\n<h6 class=\\"vlist\\">Highlights</h6>\r\n<ul class=\\"vlist\\">\r\n<li><a>Located in Queens, NY</a></li>\r\n<li><a>15 min. from JFK</a></li>\r\n<li><a>10 min. from LGA</a></li>\r\n<li><a>24/7 Hotline</a></li>\r\n<li><a>Express service to NYC</a></li>\r\n</ul>\r\n</div>', '/why-couriercls.html', 3, NULL, '2012-09-10 04:00:00', '2012-09-11 01:58:18', '2012-09-25 16:07:26', 1, 1, 2, 0, 7, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(11, 'Our Fleet', 'our-fleet', NULL, NULL, '<h3>Our Fleet</h3>', NULL, '/our-fleet.html', 1, NULL, '2012-09-10 04:00:00', '2012-09-11 02:00:43', '2012-09-11 02:03:29', 1, 1, 2, 0, 8, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(12, 'CourierCLS Blog', 'couriercls-blog', NULL, NULL, '<h3>CourierCLS Blog</h3>', NULL, '/couriercls-blog.html', 1, NULL, '2012-09-10 04:00:00', '2012-09-11 02:02:19', '2012-09-25 12:54:06', 0, 1, 2, 0, 9, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(13, 'Customer Service Center', 'customer-service-center', NULL, NULL, '<h3>Customer Service Center</h3>', NULL, '/customer-service.html', 3, NULL, '2012-09-10 04:00:00', '2012-09-11 02:03:04', '2012-09-11 02:04:20', 1, 1, 2, 0, 10, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
(14, 'Privacy Policy', 'privacy-policy', NULL, NULL, '<h3>Overview</h3>\r\n<p>CourierCLS Worldwide Chauffeured Services (&ldquo;CourierCLS&rdquo;) takes your privacy very seriously and understands the importance of knowing how your personal information is being used and shared. This policy describes the types of information collected, how it may and may not be used, and how it is protected. By visiting CourierCLS&rsquo;s website, and/or using any of our services on the website, you acknowledge that you accept the policies and procedures outlined in this Privacy Policy and our use of your information in accordance with this Privacy Policy.</p>\r\n<h3>Information Collected From Users</h3>\r\n<p>In the course of your browsing the Website, CourierCLS may collect the IP/URL address of the computer through which your visit is enabled (for example your Internet Service Provider\\''s server); cookie information. Upon any registration for, and in subsequent interaction with, Website Services, CourierCLS will collect mandatory information such as your User Name, Password, primary email address, phone number, company name, and password hint question and answer. To access and make reservations, obtain receipts, through CourierCLS&rsquo; website will require you to complete a new user form. This form will request certain personal information about the Web Site user and the traveler who will use our transportation services. This information will be compiled into a profile. Such information may include at least the following; email addresses for receipts and confirmations, contact phone numbers, company name, or account number, home address and billing address, pick-up and drop-off information, credit card information.</p>\r\n<h3>How we use your information</h3>\r\n<p>CourierCLS collects user information to create a personalized experience for you and to fulfill all ground transportation requests. Once this information is collected, you are not anonymous to us; however, this information will not be shared with any third parties. CourierCLS will not place your name, email address, physical address or any other personally identifiable information into any marketing, promotional database, or mailing list. CourierCLS uses sensitive billing information (such as cardholder name, credit card number, and expiration date) for the purpose of completing the travel purchases you conduct on our site. We use other information about you for the following general purposes: to provide you with the products and services you request; travel confirmation, receipts and updates; to manage your account, including processing bills and providing travel notifications; to communicate with you in general; to respond to your questions and comments; to measure interest in and improve our products, services, and Web site; to notify you about special offers and products or services that may be of interest to you; to otherwise customize your experience with CourierCLS.com; to reward you as part of any reward and recognition program; to solicit information from you, including through surveys; to resolve disputes, or troubleshoot problems; to enforce our Terms of Use.</p>\r\n<h3>Security</h3>\r\n<p>We have established and maintain the highest level of security to safeguard the confidentiality of your Personally Identifiable Information, including the use of encryption, firewalls, and Secure Socket Layers. In an effort to protect all data against loss and unauthorized access, we employ many different security techniques to protect such data from unauthorized access by users inside and outside the company including regulating the physical and virtual access to any root access, database(s), servers, back-ups, encryption keys or other network and security-related infrastructure components. In addition, sensitive information such as passwords are encrypted before being stored in our systems such that even if a breach were to occur and access to the data achieved, the data would still be encrypted. Please be aware that while we take efforts to safeguard your user information, \\"perfect security\\" does not exist on the Internet.</p>\r\n<h3>Changes to the CourierCLS&rsquo; Privacy Policy</h3>\r\n<p>You agree that CourierCLS may amend this policy from time to time by posting the revised Privacy Policy on this Website. Please check the revision date at the top of this page to determine whether the policy has been modified since you last reviewed it. Your continued use of any portion of the Website or CourierCLS&rsquo; service following the posting of the revised policy will constitute your acceptance of the changes.</p>', NULL, '/privacy-policy.html', 3, NULL, '2012-09-10 04:00:00', '2012-09-11 02:17:25', '2012-09-11 02:17:42', 1, 1, 2, 0, 11, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL);
