INSERT INTO `form_emailtemplates` (`id`, `name`, `subject`, `template`) VALUES
(2, 'reservation-confirmation', 'CourierCLS - Conf #{reservation_number} For {first_name} {last_name}', '<table style=\\"border-collapse: collapse; width: 100%;\\" border=\\"0\\" cellspacing=\\"0\\" cellpadding=\\"3\\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\\"2\\" width=\\"56%\\" height=\\"25\\">{logo}</td>\r\n<td width=\\"44%\\" height=\\"25\\" align=\\"right\\"><span style=\\"font-size: medium;\\"><strong>Confirmation</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\\"3\\" width=\\"100%\\" height=\\"10\\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\\"border-bottom: 2px solid #3087b1;\\" colspan=\\"2\\" width=\\"56%\\" height=\\"25\\" bgcolor=\\"#E5F2F8\\"><span style=\\"font-size: medium;\\">Reservation Confirmation #{reservation_number}</span></td>\r\n<td style=\\"border-bottom: 2px solid #3087b1;\\" width=\\"44%\\" height=\\"25\\" align=\\"right\\" bgcolor=\\"#E5F2F8\\">Last Modified On: {reservation_date}</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\\"3\\" width=\\"100%\\" height=\\"10\\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\\"3\\" width=\\"100%\\">Thank You for traveling with CourierCLS. Below please find your confirmation. If any of the information appears to be incorrect, please contact our office immediately to correct it.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\\"3\\" width=\\"100%\\">\r\n<hr size=\\"1\\" />\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\\"26%\\"><strong>Pick-up Date:</strong></td>\r\n<td colspan=\\"2\\" width=\\"74%\\">{pickup_date}</td>\r\n</tr>\r\n<tr>\r\n<td width=\\"26%\\"><strong>Pick-up Time:</strong></td>\r\n<td colspan=\\"2\\" width=\\"74%\\">{pickup_time}</td>\r\n</tr>\r\n<tr>\r\n<td width=\\"26%\\"><strong>Trip Route:</strong></td>\r\n<td colspan=\\"2\\" width=\\"74%\\">{direction}</td>\r\n</tr>\r\n<tr>\r\n<td width=\\"26%\\"><strong>Passenger:</strong></td>\r\n<td colspan=\\"2\\" width=\\"74%\\">{first_name} {last_name}</td>\r\n</tr>\r\n<tr>\r\n<td width=\\"26%\\"><strong>Phone Number:</strong></td>\r\n<td colspan=\\"2\\" width=\\"74%